import React from "react";

function Categories() {
  return (
    <div style={{ backgroundColor: "white", padding: "2rem" }}>
      <h1>Categories Page</h1>
      <button style={{ backgroundColor: "red", color: "white" }}>Whiskey</button>
      <button style={{ backgroundColor: "red", color: "white" }}>Vodka</button>
      <button style={{ backgroundColor: "red", color: "white" }}>Wine</button>
      <button style={{ backgroundColor: "red", color: "white" }}>Beer</button>
    </div>
  );
}

export default Categories;
